import React, { useEffect, useRef } from 'react';
import { MapContainer, TileLayer, Polyline, Marker, Popup, useMap } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

// Fix Leaflet default marker icons
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/images/marker-icon-2x.png',
  iconUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/images/marker-icon.png',
  shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/images/marker-shadow.png',
});

function MapController({ home, office, routes, selectedRouteId }) {
  const map = useMap();
  
  useEffect(() => {
    if (!home || !office || !routes || routes.length === 0) return;
    
    const allPoints = routes
      .flatMap(r => r.points)
      .concat([home, office]);
    
    if (allPoints.length === 0) return;
    
    const bounds = L.latLngBounds(allPoints.map(p => [p.lat, p.lon]));
    map.fitBounds(bounds, { padding: [50, 50] });
  }, [home, office, routes, map]);
  
  return null;
}

function CommuteMap({ home, office, routes, selectedRouteId }) {
  // eslint-disable-next-line no-unused-vars
  const mapRef = useRef(null);

  if (!home || !office) {
    return (
      <div style={{ 
        height: '360px', 
        borderRadius: '12px', 
        background: '#f3f4f6', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'center',
        color: '#6b7280'
      }}>
        Enter home and office locations to see map
      </div>
    );
  }

  const centerLat = (home.lat + office.lat) / 2;
  const centerLon = (home.lon + office.lon) / 2;

  const createCustomIcon = (color, label) => {
    return L.divIcon({
      className: 'custom-marker',
      html: `<div style="
        background-color: ${color};
        width: 20px;
        height: 20px;
        border-radius: 50%;
        border: 3px solid white;
        box-shadow: 0 2px 8px rgba(0,0,0,0.3);
        display: flex;
        align-items: center;
        justify-content: center;
        font-size: 10px;
        font-weight: bold;
        color: white;
      ">${label}</div>`,
      iconSize: [20, 20],
      iconAnchor: [10, 10]
    });
  };

  const homeIcon = createCustomIcon('#10b981', 'H');
  const officeIcon = createCustomIcon('#667eea', 'O');

  return (
    <div style={{ height: '360px', borderRadius: '12px', overflow: 'hidden', border: '1px solid #e5e7eb' }}>
      <MapContainer
        center={[centerLat, centerLon]}
        zoom={12}
        style={{ height: '100%', width: '100%' }}
        ref={mapRef}
      >
        <TileLayer
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        
        <MapController home={home} office={office} routes={routes} selectedRouteId={selectedRouteId} />
        
        {/* Start marker */}
        <Marker position={[home.lat, home.lon]} icon={homeIcon}>
          <Popup>
            <strong>Home</strong><br />
            {home.name}
          </Popup>
        </Marker>
        
        {/* End marker */}
        <Marker position={[office.lat, office.lon]} icon={officeIcon}>
          <Popup>
            <strong>Office</strong><br />
            {office.name}
          </Popup>
        </Marker>
        
        {/* Route polylines */}
        {routes && routes.map((route) => {
          const positions = route.points.map(p => [p.lat, p.lon]);
          const opacity = selectedRouteId && selectedRouteId !== route.id ? 0.3 : 1;
          const weight = selectedRouteId && selectedRouteId === route.id ? 5 : 3;
          
          return (
            <Polyline
              key={route.id}
              positions={positions}
              pathOptions={{
                color: route.color || '#667eea',
                weight: weight,
                opacity: opacity,
                dashArray: route.id.includes('alt') ? '10, 5' : undefined
              }}
              eventHandlers={{
                click: () => {
                  // Could add route selection handler here
                }
              }}
            />
          );
        })}
      </MapContainer>
    </div>
  );
}

export default CommuteMap;
